// Header.js
import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Header = () => {
  return (
    <View style={styles.header}>
      <Text>This is the Header</Text>
    </View>
  );
};
const styles = StyleSheet.create({
  header: {  
    width: "100%",
    height:'50px',
    backgroundColor: 'red',
    alignItems: 'center',
    justifyContent: 'center',
  }
});

export default Header;
